import "./App.css";
import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
// import Sidebar from "./components/pages/Sidebar"; //for testing
import Home from "./pages";
import Particles from "react-particles-js";

function App() {
  return (
    <div>
      <Router>
        <div
          style={{
            position: "absolute",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%",
          }}
        >
          <Particles
            params={{
              particles: {
                number: {
                  value: 50,
                },
                size: {
                  value: 3,
                },
              },
              interactivity: {
                events: {
                  onhover: {
                    enable: true,
                    mode: "repulse",
                  },
                },
              },
            }}
          />
        </div>
        <div
          style={{
            position: "absolute",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%",
          }}
        >
          <h1>Testing</h1>
          {/* You can render <Route> and <NavTabs /> here */}
        </div>
        <Home />
      </Router>
    </div>
  );
}

export default App;
